function validatedate(inputText) {
  if (inputText) {
    var dateformat = /^\s*(3[01]|[12][0-9]|0?[1-9])\.(1[012]|0?[1-9])\.((?:19|20)\d{2})\s*$/;

    if (inputText.match(dateformat)) {
      var opera2 = inputText.split('.');
      var lopera2 = opera2.length;

      if (lopera2 > 1) {
        var dd = parseInt(opera2[0]);
        var mm = parseInt(opera2[1]);
        var yy = parseInt(opera2[2]);
      }

      var ListofDays = [31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31];

      if (mm == 1 || mm > 2) {
        if (dd > ListofDays[mm - 1]) {
          displayNotification('Please enter correct date!');
          return false;
        }
      }

      if (mm == 2) {
        var lyear = false;

        if (!(yy % 4) && yy % 100 || !(yy % 400)) {
          lyear = true;
        }

        if (lyear == false && dd >= 29) {
          displayNotification('Please enter correct date!');
          return false;
        }

        if (lyear == true && dd > 29) {
          displayNotification('Please enter correct date!');
          return false;
        }
      } else {
        return true;
      }
    } else {
      displayNotification("Please enter date in dd.mm.yyyy format!");
      return false;
    }
  }
}

